script: |
  super -f text -I q810.spq | sort > q810.out

inputs:
  - name: q810.spq
    data: |
      SELECT DISTINCT - ( 39 ) FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q810.out
    data: |
      -39
